parts:
{
  "name": "UBX-NAV-RELPOSNED-V0",
  "message_id": "0x01 0x3C",
  "payload_length": 40,
  "description": "Relative positioning information in NED frame",
  "fields": [
    {
      "byte_offset": 0,
      "name": "version",
      "type": "U1",
      "description": "Message version (0x00 for this version)"
    },
    {
      "byte_offset": 1,
      "name": "reserved1",
      "type": "U1",
      "description": "Reserved"
    },
    {
      "byte_offset": 2,
      "name": "refStationId",
      "type": "U2",
      "description": "Reference Station ID. Must be in the range 0..4095"
    },
    {
      "byte_offset": 4,
      "name": "iTOW",
      "type": "U4",
      "unit": "ms",
      "description": "GPS time of week of the navigation epoch. See the description of iTOW for details."
    },
    {
      "byte_offset": 8,
      "name": "relPosN",
      "type": "I4",
      "unit": "cm",
      "description": "North component of relative position vector"
    },
    {
      "byte_offset": 12,
      "name": "relPosE",
      "type": "I4",
      "unit": "cm",
      "description": "East component of relative position vector"
    },
    {
      "byte_offset": 16,
      "name": "relPosD",
      "type": "I4",
      "unit": "cm",
      "description": "Down component of relative position vector"
    },
    {
      "byte_offset": 20,
      "name": "relPosHPN",
      "type": "I1",
      "scaling": 0.1,
      "unit": "mm",
      "description": "High-precision North component of relative position vector. Must be in the range -99 to +99. The full North component of the relative position vector, in units of cm, is given by relPosN + (relPosHPN * 1e-2)"
    },
    {
      "byte_offset": 21,
      "name": "relPosHPE",
      "type": "I1",
      "scaling": 0.1,
      "unit": "mm",
      "description": "High-precision East component of relative position vector. Must be in the range -99 to +99. The full East component of the relative position vector, in units of cm, is given by relPosE + (relPosHPE * 1e-2)"
    },
    {
      "byte_offset": 22,
      "name": "relPosHPD",
      "type": "I1",
      "scaling": 0.1,
      "unit": "mm",
      "description": "High-precision Down component of relative position vector. Must be in the range -99 to +99. The full Down component of the relative position vector, in units of cm, is given by relPosD + (relPosHPD * 1e-2)"
    },
    {
      "byte_offset": 23,
      "name": "reserved2",
      "type": "U1",
      "description": "Reserved"
    },
    {
      "byte_offset": 24,
      "name": "accN",
      "type": "U4",
      "scaling": 0.1,
      "unit": "mm",
      "description": "Accuracy of relative position North component"
    },
    {
      "byte_offset": 28,
      "name": "accE",
      "type": "U4",
      "scaling": 0.1,
      "unit": "mm",
      "description": "Accuracy of relative position East component"
    },
    {
      "byte_offset": 32,
      "name": "accD",
      "type": "U4",
      "scaling": 0.1,
      "unit": "mm",
      "description": "Accuracy of relative position Down component"
    },
    {
      "byte_offset": 36,
      "name": "flags",
      "type": "X4",
      "description": "Flags",
      "bitfield_members": [
        {
          "name": "gnssFixOK",
          "bit_offset": 0,
          "bit_length": 1,
          "description": "A valid fix (i.e within DOP & accuracy masks)"
        },
        {
          "name": "diffSoln",
          "bit_offset": 1,
          "bit_length": 1,
          "description": "1 if differential corrections were applied"
        },
        {
          "name": "relPosValid",
          "bit_offset": 2,
          "bit_length": 1,
          "description": "1 if relative position components and accuracies are valid"
        },
        {
          "name": "carrSoln",
          "bit_offset": 3,
          "bit_length": 1,
          "description": "Carrier phase range solution status: 0 = no carrier phase range solution, 1 = carrier phase range solution with floating ambiguities, 2 = carrier phase range solution with fixed ambiguities"
        },
        {
          "name": "isMoving",
          "bit_offset": 4,
          "bit_length": 1,
          "description": "1 if the receiver is operating in moving baseline mode (not supported in protocol versions less than 20.3)"
        },
        {
          "name": "refPosMiss",
          "bit_offset": 5,
          "bit_length": 1,
          "description": "1 if extrapolated reference position was used to compute moving baseline solution this epoch (not supported in protocol versions less than 20.3)"
        },
        {
          "name": "refObsMiss",
          "bit_offset": 6,
          "bit_length": 1,
          "description": "1 if extrapolated reference observations were used to compute moving baseline solution this epoch (not supported in protocol versions less than 20.3)"
        },
        {
          "name": "reserved3",
          "bit_offset": 7,
          "bit_length": 25,
          "description": "Reserved"
        }
      ]
    }
  ]
}
